import React, { useEffect } from 'react';
import { useStarWarsContext } from '../Context/StarWarsContext';

const TablePlanets = () => {
  const { data, fetchPlanetsStarWars } = useStarWarsContext();

  useEffect(() => {
    fetchPlanetsStarWars();
  }, []);

  return (
    <table>
      <tr>
        <th>Name</th>
        <th>Rotation Period</th>
        <th>Orbital Period</th>
        <th>diameter</th>
        <th>Climate</th>
        <th>Gravity</th>
        <th>Terrain</th>
        <th>Surface Water</th>
        <th>Population</th>
        <th>Films</th>
        <th>Created</th>
        <th>Edited</th>
        <th>URL</th>
      </tr>
      {data.map((
        { name,
          rotation_period,
          orbital_period,
          diameter,
          climate,
          gravity,
          terrain,
          surface_water,
          population,
          films,
          created,
          edited,
          url,
        },
      ) => (name)) }
    </table>
  );
};

export default TablePlanets;
